import { ArrowRight, ArrowDown, Search, Star, Minus } from "../../common/Svg/Svg";

import "../Cart/Cart.scss";

export default function Cart() {
    return (
        <div className="func-block__item ">
            <span className="cart__count">Cart(0)</span>
        </div>
    );
}
